VALUES ('2600112060749', 'Quenelle de veau', '4 minutes environ dans le jus ou recouyertes d\'une sauce. - A la casserole : 6 minutes environ dans le jus ou recouvertes d\'une sauce. - Bain-marie : 15 minutes dans la boite ouverte. - Four traditionnel : 20 minutes à 180cc recouvertes d\'une sauce et de fromage râpé. MINIMUM 22 QUENELLES DE VEAU POUR GARNITURE Ingrédients de la quenelle : Farine de blé, graisse de bœuf, eau, viande de veau (13% à la mise en Œuvre), blancs d\'œufs, sel, gluten de blé, lactose et protéines de lait, extrait naturel de poivre. Liquide de couverture : eau. Allergènes : blé, œufs, lait. A consommer de préférence avant la date figurant sur l\'un des fonds. : À conserver dans un local frais et sec. Après ouverture : à conserver au réfrigérateur et à consommer rapidement.', 'https://static.openfoodfacts.org/images/products/260/011/206/0749/front_fr.4.400.jpg', '12.1', '7.6', '12', '1.66', '', '4', '0.96', '0.377952755905512', '', '1');

