VALUES ('2600194021850', 'EXTRA Salade & Fusilli Caesar Poulet et Oeuf, 330g', '141 g de Maxi Fusilli cuisinées (42,7%) : Pâtes alimentaires cuites 39,5% (eau, semoule de _blé_ dur), tomates 0.8%, huile de colza, basilic 0,8%, ail, sel. 100 g d’Ingrédients Savoureux (30,3%) : _oeufs_ durs 13.6%, émincés de filet de poulet traité en salaison cuit rôti 10% (filet de poulet 9,8% (origine : Hors UE), sel, amidon de tapioca, dextrose), tomates cerise 4,5%, _fromage_ italien 2,1% (_lait_ de vache cru, sel, présure, conservateur : lysozyme (_œuf_)). 50 g de Salades mélangées (15,2%) : Laitue, chicorée et roquette. 35 g de Sauce au Parmigiano Reggiano (10,6%) :  eau, huile de colza, huile d’olive vierge extra, _Parmigiano Reggiano_ 0,4%, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre d‘alcool, sel, antioxydant : disulfite de potassium, acidifiant : acide citrique), jus concentré de citron, sel, jaune d’_œuf_, ail, amidon modifié de pomme de terre, basilic, acidifiant : acide lactique, épaississant : gomme xanthane, conservateur : sorbate de potassium. 4 g de Sachet de Crumble Salé (1,2%) : farine de _blé_, huile de tournesol haut oléique, sel, levure.', 'https://static.openfoodfacts.org/images/products/260/019/402/1850/front_fr.4.400.jpg', '7.4', '1.7', '13', '1.2', '1.5', '8.4', '0.54', '0.21259842519685', '', '1');

